const newPollFields = () => {return ([
  {name: "subject", label: "Subject", type: "text" },
  {name: "author", label: "Author", type: "text" },
  {name: "password", label: "Password", type: "password" },
  {name: "confirmPassword", label: "Confirm Password", type: "password" },
  {name: "expires", label: "Expires in...", type: "time" },
  {name: "format", label: "Results Format", type: "text" },
  {name: "option1",label: "Option 1", type: 'text'},
  {name: "option2",label: "Option 2", type: 'text'}]
)}

const updatePollFields = () => {return(
  [{name: "format", label: "Results Format", type: "text" }]
)}

module.export = {
  newPollFields: newPollFields,
  updatePollFields: updatePollFields
}
